import React, { Component } from "react";
import "../fcss/main.css";
import "../fcss/material-design-iconic-font.min.css";
import "../fcss/daterangepicker.css";
import "../fcss/font-awesome.min.css";
import "../fcss/select2.min.css";

class BuyForm extends Component {
  state = {};

  buySearchButtonClick = () => {
    window.location.href = "/buy";
  };

  addBuyButtonClick = () => {
    window.location.href = "/buy/newBuy";
  };

  render() {
    return (
      <div class="page-wrapper bg-gra-02 p-t-130 p-b-100 font-poppins">
        <div class="wrapper wrapper--w680">
          <div class="card card-4">
            <div class="card-body">
              <h2 class="title">Registration Form</h2>
              <form
                method="POST"
                action="172.16.38.62:8080/apis/post/buy"
                target="_blank"
              >
                <div class="row row-space">
                  <div class="col-2">
                    <div class="input-group">
                      <label class="label">Product/Service Name</label>
                      <input
                        class="input--style-4"
                        type="text"
                        name="first_name"
                      />
                    </div>
                  </div>
                </div>
                <div class="row row-space">
                  <div class="col-2">
                    <div class="input-group">
                      <label class="label">Date of Request</label>
                      <div class="input-group-icon">
                        <input
                          class="input--style-4 js-datepicker"
                          type="text"
                          name="birthday"
                        />
                        <i class="zmdi zmdi-calendar-note input-icon js-btn-calendar"></i>
                      </div>
                    </div>
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default BuyForm;
